Green Lantern: The Animated Series - Complete (WEB-DL - MP4)
------------------------------------------------------------

The Green Lantern lights up adventure in this all-new CG animated action series
from world-renowned producer, artist and animator Bruce Timm. Based upon the
DC Comics legend, this 26-episode groundbreaking superhero series follows
Earth's Green Lantern, Hal Jordan, a onetime test pilot whoÃ¢â‚¬â„¢s used to being in
dangerous situations - but he's never faced anything like this! Set in the
farthest reaches of deep space, GREEN LANTERN: THE ANIMATED SERIES finds Hal on
the Guardian Frontier, where he must face down an invasion from the Red Lantern
Corps. Powered by pure rage, the evil Red Lanterns have sworn to destroy the
Green Lantern Corps and everything they stand for. Dispatchedon the experimental
spacecraft The Interceptor, Hal is soon joined by an all-new group of heroes on
a mission to protect Guardian Space - and the Green Lantern Corps itself!

Produced by Cartoon Network and Warner Bros. Animation.

